  \"2016-07-27T23:02:20.227199\",\n\t\"name\": \"waterfowl-population-and-habitat-study-kenai-national-moose-range-kenai-alaska-special-rep\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During the period between May 27 and August
  28, 1961, a waterfowl population and habitat study was conducted on the Kenai National
  Moose Range by personnel of the Bureau of Sport Fisheries and Wildlife. No previous
  investigations have been made on waterfowl population or on available waterfowl
  habitat except for the extensive work done on the trumpeter swan which nest in the
  northern area of the Moose Range. The results of this study will give an indication
  of the population density of u201clay-overu201d waterfowl to include preferred habitat
  and nesting activity.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
